import React,{ useState,useEffect } from 'react'


function App() {
  const [data,setdata] = useState('');

  useEffect(() =>{
    async function fetchData(){
      const response = await fetch('/api/data');
      const jsonData = await response.json();
      setdata(jsonData.message);
    }
    fetchData();
  })
  return (
    <div>
      <header>
        <p>{data}</p>
      </header>
    </div>
  )
}

export default App
